import React from 'react';
import { AppProvider, useApp } from './context/AppContext.tsx';
import { AuthContainer } from './components/auth/AuthContainer.tsx';
import { Layout } from './components/layout/Layout.tsx';
import { GarageView } from './components/garage/GarageView.tsx';

// Placeholder components for other views
function ListingsView() {
  return (
    <div className="text-center py-16">
      <h1 className="text-3xl font-bold text-primary-100 mb-4">Listings</h1>
      <p className="text-primary-300">Vehicle listings marketplace coming soon...</p>
    </div>
  );
}

function AuctionsView() {
  return (
    <div className="text-center py-16">
      <h1 className="text-3xl font-bold text-primary-100 mb-4">Auctions</h1>
      <p className="text-primary-300">Vehicle auctions coming soon...</p>
    </div>
  );
}

function TradesView() {
  return (
    <div className="text-center py-16">
      <h1 className="text-3xl font-bold text-primary-100 mb-4">Trades</h1>
      <p className="text-primary-300">Trade management coming soon...</p>
    </div>
  );
}

function MessagesView() {
  return (
    <div className="text-center py-16">
      <h1 className="text-3xl font-bold text-primary-100 mb-4">Messages</h1>
      <p className="text-primary-300">Messaging system coming soon...</p>
    </div>
  );
}

function ProfileView() {
  return (
    <div className="text-center py-16">
      <h1 className="text-3xl font-bold text-primary-100 mb-4">Profile</h1>
      <p className="text-primary-300">Profile management coming soon...</p>
    </div>
  );
}

function AppContent() {
  const { state, activeTab } = useApp();

  if (!state.isAuthenticated) {
    return <AuthContainer />;
  }

  const renderCurrentView = () => {
    switch (activeTab) {
      case 'garage':
        return <GarageView />;
      case 'listings':
        return <ListingsView />;
      case 'auctions':
        return <AuctionsView />;
      case 'trades':
        return <TradesView />;
      case 'messages':
        return <MessagesView />;
      case 'profile':
        return <ProfileView />;
      default:
        return <GarageView />;
    }
  };

  return (
    <Layout>
      {renderCurrentView()}
    </Layout>
  );
}

function App() {
  return (
    <AppProvider>
      <AppContent />
    </AppProvider>
  );
}

export default App;
